arning: Firebase Crashlytics upload script not found.\"\n    echo \"   The script was searched in:\"\n    echo \"   - ${BUILD_DIR%/Build/*}/SourcePackages/checkouts/firebase-ios-sdk/Crashlytics/run\"\n    echo \"   - ${DERIVED_DATA_DIR}/SourcePackages/checkouts/firebase-ios-sdk/Crashlytics/run\"\n    echo \"   Make sure:\"\n    echo \"   1. FirebaseCrashlytics is added via Swift Package Manager\"\n    echo \"   2. The project has been built at least once\"\n    echo \"   3. GoogleService-Info.plist is in the app bundle\"\nfi\n";
